  false,\n\t\"url\": null,\n\t\"notes\": \"The Lophelia II project involves exploration
  and research of the northern Gulf of Mexico deepwater natural and artificial hard
  bottom habitats with emphasis on coral communities.  In order to better understand
  the deep water coral reefs, operations will involve primarily dives with the JASON
  II ROV for deployments, collections, and video.  Dive operations will be performed
  over 15 to 20 targeted locations, at which elevators will be deployed and recovered
  for the large number of collections expected.  Multibeam surveys will be performed
  over targeted areas for operational use.  The JASON ROV will be equipped with a
  sonar for obstacle avoidance.  Twelve to fifteen CTD casts with Niskin rosettes
  will be deployed and four to six previously deployed moorings will be recovered.\",\n\t\"license_title\":
